descriptor.controllerScript:
// Declare global variables (elements, colors, etc.)
let cardIconUrl;
let cardTitleText;
let telemetryKeyPrefix;
let postProcessing;
// elements
let cardIconImg;
let cardIconContainer;
let cardTitleElement;
let cardValueElement;

let useDefaultSubscription = true;
let maxBodyHeight = 50;


const getTelemetryValue = (subscription) => {
    const {data: subscriptionData} = subscription;
    
    if(subscriptionData.length < 1) return null;
    const data = subscriptionData[0].data[0];
    
    if(!data || data.length < 1) return null;
    
    const value = data[1];
    
    // console.log({value});
    
    return value;
};

const onDataUpdated = function(subscription){
    // console.log("onDataUpdated", {subscription});
    renderDisplayValue(subscription);
};

const renderDisplayValue = function(subscription){
    const value = getTelemetryValue(subscription);
    let displayValue = value;
    
    if(postProcessing.enabled){
        const postProcessingFunc = new Function("value", postProcessing.functionStr);
        displayValue = postProcessingFunc(value);
    }
    // console.log("value", displayValue);
    
    cardValueElement.html(displayValue === null || displayValue === "" ? "---" : displayValue);
}

const createTelemetryKeySubscription = (subscriptionsInfo) => {
    const {subscriptionApi} = self.ctx;
    
    const subscriptionOptions = {
        callbacks: {
            onDataUpdated: (subscription, detectChanges) => ctx.ngZone.run(() => {
                        onDataUpdated(subscription, detectChanges);
            }),
            // onDataUpdateError: (subscription, e) => ctx.ngZone.run(() =>{
            //         onDataUpdateError(subscription, e);
            // }),
            dataLoading: (dataLoad) => {
                // console.log({dataLoad})
            }
        }
    };
            
    return subscriptionApi.createSubscriptionFromInfo("latest", subscriptionsInfo, subscriptionOptions, false, true);
};

const fetchRoomNumber = function(entityId){
    return self.ctx.attributeService.getEntityAttributes(entityId, "SERVER_SCOPE", ["roomNum"]);
};

// Render initial UI elements, get attributes/telemetry and/or make API requests
const renderInitUi = function(){
    const {defaultSubscription, attributeService} = self.ctx; 
    // Render card icon
    cardIconImg.attr({src: cardIconUrl});
    
    // Render card title
    cardTitleElement.html(cardTitleText);
    
    renderDisplayValue(defaultSubscription);
    
    handleResize();
    
    const {datasources, data} = defaultSubscription;
    
    if(!datasources || datasources.length < 1) return;
    // Check if a datakey is defined in the settings
    
    const {entityId, entityType, dataKeys} = datasources[0];
    
    const dataKeysDefined = dataKeys && dataKeys.length > 0;
    
    if(dataKeysDefined) return;
    
    if(!telemetryKeyPrefix) return;
    
    // Create custom subscription since no data key is defined
    useDefaultSubscription = false;
    
    fetchRoomNumber({id: entityId, entityType}).subscribe(function(result){
        if(result.length < 1) return;
        const roomNum = result[0].value;
        // console.log({roomNum});
        // Create the subscriptions info array and subscribe to telemetry key(s)
        const telemetryKey = telemetryKeyPrefix + "_" + roomNum;
        const subscriptionsInfo = [{
            type: "entity",
            entityType,
            entityId,
            timeseries: [{name: telemetryKey}]
        }];
        createTelemetryKeySubscription(subscriptionsInfo).subscribe(function(subscription){
            // console.log({subscription});
        });
    });
};

self.onInit = function() {
    const ctx = self.ctx;
    // console.log({ctx});
    const {$scope, settings, $container} = ctx;
    
    // Initial handlers (functions to handle dashboard workarounds, e.g. handling fullscreen mode)
    handleWidgetContainerStyles();
    // Define DOM elements
    cardIconImg = $container.find(".card__icon img");
    cardIconContainer = $container.find(".card__icon");
    cardBodyElement = $container.find(".card__body");
    cardValueElement = $container.find(".card__value");
    cardTitleElement = $container.find(".card__title");
    
    // Get settings
    cardIconUrl = settings.cardIcon;
    cardTitleText = settings.cardTitleText;
    telemetryKeyPrefix = settings.telemetryKeyPrefix;
    postProcessing = settings.postProcessing;
    
    
    // Load static assets (images, svg, etc.)
    
    
    
    // Render initial UI
    renderInitUi();
    
};


self.onDataUpdated = function() {
    const {defaultSubscription} = self.ctx;
    
    if(!useDefaultSubscription) return;
    
    renderDisplayValue(defaultSubscription);
};

self.onResize = function() {
    handleResize()
};

self.onDestroy = function() {
    
};

const handleResize = function() {
    const {width, height} = self.ctx;
    
    const maxTitleSize = 18;
    const maxValueSize = 24;
    // console.log({height, width})
    if(height < 80){
        const length = 0.7 * height;
        
        cardIconContainer.css({
            height: length,
            width: length
        });
        
        cardBodyElement.css({height: length});
        cardTitleElement.css({fontSize: length * (maxTitleSize/maxBodyHeight)});
        cardValueElement.css({fontSize: length * (maxValueSize/maxBodyHeight)});
    }else{
        cardIconContainer.css({
            height: maxBodyHeight,
            width: maxBodyHeight
        });
        cardTitleElement.css({fontSize: maxTitleSize})
        cardValueElement.css({fontSize: maxValueSize})
    }
}

function handleWidgetContainerStyles(){
    self.ctx.$container.css({
        display: "flex",
        // justifyContent: "center",
        alignItems: "center"
    });
}

self.typeParameters = function() {
    return {
        maxDatasources: 1,
        maxDataKeys: 1,
        // hasDataPageLink: true,
        // warnOnPageDataOverflow: false,
        dataKeysOptional: true
    };
}

self.onEditModeChanged = function() {
   
};

self.onLatestDataUpdated = function() {
   
}

