              "title": "Telemetry Key Prefix",
              "type": "string"
            },
            "postProcessing":{
              "title": "Post Processing Function",
              "type": "object",
              "properties":{
                "functionStr": {
                    "title": "postProcessing(value)",
                    "type": "string",
                    "default":  "return value;"
                },
                "enabled":{
                    "title": "Enable",
                    "type": "boolean",
                    "default": false
                }
              }
            },
            "cardIcon": {
                "title": "Card Icon",
                "type": "string"
            }
        },
        "required": ["cardTitleText"]
    },
    "form": [
        "cardTitleText",
        "telemetryKeyPrefix",
        {
            "key": "postProcessing",
            "items":[
                "postProcessing.enabled",
                {
                    "key": "postProcessing.functionStr",
                    "type": "javascript"
                }
            ]
        },
        {
            "key": "cardIcon",
            "type": "image"
        }
    ]
}

